const MovieItem = ({ movies }) => {

    if (!movies){
        console.log("loading")
        setTimeout(() => {
            return <h1>Loading</h1>
        }, 3000)

    }
    return (
        <div>
            <ul>
              <li>{movies.title}</li>
            </ul>
        </div>
    )
}

export default MovieItem
